import React, { Fragment, useState } from "react";
import ReactDom from "react-dom";
import "./Modal.css";

function SignUpModal(props) {
  const [defaultStyle, setDefaultState] = useState({});

  if (!props.statusTunnel) {
    return;
  }
  let emailInserted 
  let listener = function (e) {
    let emailInserted = e.target.value;
    console.log(emailInserted);

  };

  const clicker = function () {
    if (emailInserted.length == 0) {
      console.log("clicked with empty data");
      setDefaultState({ background: "black" });
    }
  };

  return ReactDom.createPortal(
    <div className="modal-wrapper">
      <form>
        <div>
          <label for="uname">
            <b>Username</b>
          </label>
          <input
            style={defaultStyle}
            type="text"
            placeholder=""
            name="uname"
            onChange={listener}
            required
          />
        </div>
        <div>
          <label for="psw">
            <b>Password</b>
          </label>
          <input
            style={defaultStyle}
            type="password"
            placeholder=""
            name="psw"
            required
          />
        </div>
        <button type="submit" onClick={clicker}>
          Sign Up
        </button>
      </form>
      <div className="alert-title">
        Do you have an account already? Then you are ready to{" "}
        <button onClick={props.changerTunnel}>login!</button>
      </div>
    </div>,
    document.getElementById("modal2")
  );
}

export default SignUpModal;
